import styled from "styled-components";


export const Container = styled.section`

    display: grid;
    grid-template-rows: repeat(4, 1fr);
    margin: 0 auto;
    width: 100%;
    height: 100vh;
    max-width: 1120px;

    margin-top: 3rem;

    .content {
        display: grid;
        grid-template-columns: repeat(4, 1fr);
        background: var(--shape);
        margin-top: 10px;
        padding: 1rem;
        border-radius: 5px;        
    }

    .content div {
        text-align: end;
    }

    .content-header {
        display: flex;
        justify-content: space-between;
        margin-top: 10px;
        padding: 1rem;
        color: var(--text-title);
        text-align: start;
    }
`
